                <div className="left">
                    <SideBar/>
                </div>
                <div className="right">
                    {/* <Routes>
                    <Route path="/" element={<Dashboard />} />
                    <Route path="/import" element={<Import/>} />
                    
                    </Routes>
                     */}
                </div>
            </div>
            {/* </Router> */}
        </>
    );
}
export default HomePage;
